import React from 'react';
import PropTypes from 'prop-types';
import Button from '../Button/Button';
import './ConfirmDelete.css';

const ConfirmDelete = ({ toggleShowConfirmDelete, deletePack, selectedModpack }) => {
    return (
        <div className='confirm-delete'>
            <p className='confirm-delete-header'>Confirm Deletion</p>
            <p className='confirm-delete-body'>Are you sure you want to permanently delete this item?</p>
            <div className='confirm-delete-buttons'>
                <Button width={50} height={10} fontSize="11px" text="Cancel" type="cancel" onClick={toggleShowConfirmDelete} />
                <Button width={50} height={10} fontSize="11px" text="Delete" type="delete" onClick={() => deletePack(selectedModpack)} />
            </div>
        </div>
    );
};

ConfirmDelete.propTypes = {
    toggleShowConfirmDelete: PropTypes.func.isRequired,
    deletePack: PropTypes.func.isRequired,
    selectedModpack: PropTypes.object.isRequired,
};

export default ConfirmDelete;
